class Solution {
    public int maxNumberOfAlloys(int n, int k, int budget, List<List<Integer>> composition, List<Integer> stock, List<Integer> cost) {
        int result = 0;
        for (int i = 0; i < k; i++) {
            int minAlloy = Integer.MAX_VALUE;
            for (int j = 0; j < n; j++) {
                int totalCost = 0;
                for (int m = 0; m < n; m++) {
                    int needed = composition.get(i).get(m) * (j + 1) - stock.get(m);
                    if (needed > 0) {
                        totalCost += needed * cost.get(m);
                    }
                }
                if (totalCost <= budget) {
                    minAlloy = j + 1;
                } else {
                    break;
                }
            }
            result = Math.max(result, minAlloy);
        }
        return result;
    }
}
